import React from "react";
const ToDoList =(state)=>
{
    
        const {items,deleteItem} =state;
   
        
              

              
     
        return(
                <div key={items.id}>
                          <span>{items.name}</span>
                          <span>{items.age}</span>
                          <button onClick={deleteItem(items.id)}>Delete</button>
  </div>
)
   }
export default ToDoList;
